    var UTCoffset = dateObject.toString().split('GMT')[1].split(' (')[0];
    console.log('User UTC Offset: ', UTCoffset);
    if (!(UTCoffset in populousLocationsByTimeZone)) {
      UTCoffset = UTCoffset[0] + UTCoffset[1] + UTCoffset[2] + '00';
